import React from 'react';
import './SearchBar.css';
import location_icon from '../icons/location-icons/location_icon.svg';

function SearchBar() {

    return (

        <div className="slider__component--wrapper">
            <img src={location_icon} className="input__icon" alt="input__icon" />
            <label>Your current location</label>
            <input type="text" placeholder="type in your current position" className="input__field"></input>
        </div>
    )
}

export default SearchBar;
